import React from 'react';

const SelectOption = () => {
    return (
        <div>
            <select>
                <option value="All">All</option>
                <option value="completed">completed</option>
                <option value="uncompleted">uncompleted</option>
            </select>
        </div>
    );
};

export default SelectOption;
